import React, { useState } from "react";
import Header from "./Header";
import Chart from "./components/Chart"
import Dummy from "./components/Dummy"

import {
  Container,
} from "@material-ui/core";

export default function App() {


  const widget = (
    <div>
      <Dummy/>

      <Chart/>

    </div>
  );

  return (
    <div>
      <Header
        widget={
          <Container
            maxWidth="100%"
            style={{ width: "95%" }}
            children={widget}
          />
        }
      />
    </div>
  );
}
